  body: "### Fix bug when loading caffe network which reuses layers\r\n\r\nWe have\
    \ been using OpenCV dnn module to run some of our caffe models (OpenCV version\
    \ 3.4.1). After upgrading to 3.4.2 we noticed problems caused by #11461 \r\n\r\
    \nOur network reuses parameters from some of it's layers as described in our `deploy.prototxt`\
    \ file (see the layer name in the lines highlighted by `HERE`):\r\n\r\n```\r\n\
    layer {\r\n  name: \"conv1\"  type: \"Convolution\"  bottom: \"input_0\"  top:\
    \ \"conv1_0\"  <--- HERE\r\n  param { name: \"conv1_w\"    lr_mult: 1    decay_mult:\
    \ 1  }\r\n  param { name: \"conv1_b\"   lr_mult: 2    decay_mult: 0  }\r\n  convolution_param\
    \ {    num_output: 48    kernel_size: 11    stride: 4\r\n    weight_filler { \
    \     type: \"gaussian\"      std: 0.01    }\r\n    bias_filler {      type: \"\
    constant\"      value: 0    }\r\n  }\r\n}\r\n\r\n...\r\n\r\nlayer {\r\n  name:\
    \ \"conv1\"  type: \"Convolution\"  bottom: \"input_2\"  top: \"conv1_2\"   <---\
    \ HERE\r\n  param { name: \"conv1_w\"    lr_mult: 1    decay_mult: 1  }\r\n  param\
    \ { name: \"conv1_b\"   lr_mult: 2    decay_mult: 0  }\r\n  convolution_param\
    \ {    num_output: 48    kernel_size: 11    stride: 4\r\n    weight_filler { \
    \     type: \"gaussian\"      std: 0.01    }\r\n    bias_filler {      type: \"\
    constant\"      value: 0    }\r\n  }\r\n}\r\n\r\n```\r\n\r\nThe loop edited in\
    \ `opencv/modules/dnn/src/caffe/caffe_importer.cpp` used to try to copy and clear\
    \ the blob values as soon as it found matching layer name. Since our network has\
    \ two layers with the same name, when trying to copy the blob values for the second\
    \ `conv1` layer, the function would copy a cleared blob.\r\n\r\nAfter the change\
    \ the loop is searching for a layer with a matching name which does not have its\
    \ blob values cleared.\r\n\r\nWould you like me to write a separate unit test\
    \ or include it into this pull request? \r\n\r\nThank you very much for looking\
    \ into this! Please let me know if you need any more details or if I could help\
    \ somehow.\r\n\r\n\r\n```\r\nallow_multiple_commits=1\r\n```"
